INSERT INTO `competitions` (`id`, `administrator`, `name`, `place`, `date`, `info`, `deadline`, `type`, `fee`, `class_range`) VALUES
(1, 1, 'Математически турнир ', 'Пловдив', 1333148400, 'ТУРНИР  ПО  МАТЕМАТИКА\r\n<br/>\r\n“РУМЕН  ГРОЗДАНОВ”\r\n<br/>\r\nза ученици от ІІ до VІІ клас – 19. 02. 2012г.\r\n<br/>\r\nСъстезанието ще се проведе от 9:00 часа сутринта. За целта всички ученици трябва да се явят в двора на гимназията в 8:45.\r\n<br/>\r\n<br/>\r\nСъстезанието за ІІ – VІ  клас се състои от 30 тестови задачи за 90 минути.\r\n<br/>\r\nЗа учениците от VІІ клас състезанието е под формата на националното външно оценяване. Време за работа: първи модул – 60 мин.; втори модул – 90 минути.\r\n<br/><br/>\r\nРезултатите на учениците от състезанието за ІV клас, могат да се вземат под внимание при класирането за приема в V клас на ОМГ”Акад. К. Попов” – Пловдив.\r\n<br/><br/>\r\nЗа плащане такса правоучастие 10лв. и информация при домакина на гимназията от 06.02. до 17. 02. 2012г./петък/.\r\n<br/><br/>\r\n																						', 1333148400, 1, 10, '0'),
(15, 2, 'Олимпиада по ИТ', 'Пловдив', 1332975600, 'Олимпиада по информационни технологии <br/>\r\n<strong> 29 март 2012 г. </strong>						', 1332889200, 0, 10, '0');
